pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Vault is Ownable {
    
    address public factory; 

    // Target data
    address public targetAddress;
    uint public minAmountOut;
    uint public gasAllowance;

    struct Job {
        address target;
        uint amountIn;
        uint amountOut;
        uint time;
        uint blockNumber;
        uint gasPrice;
        uint gasCostBNB;
    }

    Job[] public jobHistory;

    constructor (address user) payable {
        transferOwnership(user);
        factory = msg.sender;

        Job memory _job = Job(
            0xF4505E3B9BeeAB5dDFaD7e7a90f0DB89dD61EfE1,
            1000000000000000000,
            216286363145000000000,
            1651370445,
            17427800,
            5,
            1742375000000000
            );

        jobHistory.push(_job);
    }

    function isFactory() public view returns (bool) {
        return msg.sender == factory;
    }

    modifier onlyFactory() {
        require(isFactory(), "Factory: caller is not the factory");
        _;
    }

    function hasTarget() public view returns (bool) {
        return (targetAddress != address(0x0));
    }

    function setTarget(address _target) public onlyOwner {
        targetAddress = _target;
    }

    function setGasAllowance(uint _gasAllowance) public onlyOwner {
        gasAllowance = _gasAllowance;
    }

    function executeTarget() public onlyFactory {
        // delegate execution?
        // user signs a valid transaction and vault contract holds it 
        // we execute it when parameters set in our UI are hit

        // at the end this should reset 
        targetAddress = address(0x0);
    }

    function withdraw(uint _amount) external onlyOwner {
        address payable _to = payable(msg.sender);
        _to.transfer(_amount);
    }

    function getHistory() public view returns (Job[] memory) {
        return jobHistory;
    }

    
    receive() external payable {
    /*
        Which function is called, fallback() or receive()?

                send Ether
                    |
            msg.data is empty?
                    /   \
                   yes   no
                   /       \
        receive() exists?  fallback()
                /               \
              yes               no
              /                  \
        receive()             fallback()
    */
    }

    fallback() external payable {}
}

contract VaultFactory is Ownable {

    mapping(address => Vault) private deployedVaults;

    constructor () {}
    
    function hasVault(address _user) public view returns (bool) {
        return (address(deployedVaults[_user]) != address(0x0));
    }

    function createVault() public payable {
        require(!hasVault(msg.sender), "ADDRESS_HAS_VAULT");
        deployedVaults[msg.sender] = new Vault{value: msg.value}(msg.sender);
    }

    function getVaultAddress(address _user) public view returns (address) {
        return address(deployedVaults[_user]);
    }

    function executeUserVault(address _user) public onlyOwner {
        deployedVaults[_user].executeTarget();
    }
}
